import React from 'react';
import styles from './navbar.module.css';

const Navbar = () => {
    return <div className={styles.blockNavbar}>
        <a href="#">Main</a>
        <a href="#">Users</a>
        <a href="#">Messages</a>
    </div>
}

export default Navbar;
